import React from 'react';
import { Link } from 'react-router-dom';
import '../Styles/'; // Asegúrate de tener este archivo CSS

const Sider = () => {
  return (
    <div className="container">
      <aside className="sidebar">
        <button className="sidebar-btn"><Link to = "/reserva-cita-formulario" style={{ textDecoration: 'none', color: 'inherit'}}></Link></button>
        <button className="sidebar-btn"> <Link to = "/servicios" style={{ textDecoration: 'none', color: 'inherit'}}></Link>Botón 2</button>
        <button className="sidebar-btn"> <Link to = "/atencion-psicologica" style={{ textDecoration: 'none', color: 'inherit'}}></Link>Botón 1</button>
        <button className="sidebar-btn"><Link to = "/psicoterapia" style={{ textDecoration: 'none', color: 'inherit'}}></Link>Botón 2</button>
        <button className="sidebar-btn"><Link to = "/intervencion-crisis" style={{ textDecoration: 'none', color: 'inherit'}}></Link>Botón 1</button>
        <button className="sidebar-btn"><Link to = "/" style={{ textDecoration: 'none', color: 'inherit'}}></Link>Botón 2</button>
      </aside>
      <main className="content">
        <h1>Contenido Principal</h1>
        <p>
          Este es el contenido de la página. Cuando navegues, solo esta parte de la página se desplazará.
        </p>
        <p>
          Aquí puedes añadir más contenido, como texto, imágenes, etc. 
          El contenedor de la izquierda permanecerá fijo.
        </p>
      </main>
    </div>
  );
};

export default Sider;
